query:
/*+ NoMergeJoin(mi_idx t) NoNestLoop(mi_idx t mc) */ select count(*)
from movie_info_idx AS mi_idx
inner join title AS t
on t.id = mi_idx.movie_id AND t.kind_id < 7 AND t.production_year > 1985
inner join movie_companies AS mc
on t.id = mc.movie_id AND mc.company_id > 14321 AND mc.company_type_id < 2;
